import React from "react";
import { Input } from "flwww";

const AdminLogin = () => (
  <div style={{ width: "500px" }}>
    <Input
      style={{ fontSize: "2rem", marginBottom: ".7rem" }}
      icon="user"
      placeholder="username" />

    <Input
      placeholder="Password" />
  </div>
);

export default AdminLogin;
